import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Grid, Card, Paper, ButtonBase } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    margin: 'auto',
    maxWidth: 500,
  },
  image: {
    width: 128,
    height: 128,
    borderRadius: 50
  },
  img: {
    margin: 'auto',
    display: 'block',
    maxWidth: 128,
    maxHeight: 128,
    borderRadius: 40
  },
}));

const AttentionCard = () => {
  const classes = useStyles();
  const disability = "Diabetes";

  return (
    <div className={classes.root}>
      <Paper className={classes.paper}>
        <Grid container spacing={2}>
          <Grid item>
              <ButtonBase className={classes.image}>
                <img className={classes.img} alt="complex" src="https://images.unsplash.com/photo-1541943181603-d8fe267a5dcf?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=912&q=80" />
              </ButtonBase>
            </Grid>
          <Grid item xs={12} sm container>
            <Grid item xs container direction="column" justify="flex-start" spacing={2}>
              <Grid item xs>
                <Typography gutterBottom variant="subtitle1">
                  First and last name
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  Treatment recommendation
                </Typography>
              </Grid>

            </Grid>
            <Grid item>
              <Typography variant="subtitle1">Disability</Typography>
            </Grid>
          </Grid>
        </Grid>
      </Paper>
    </div>
  );
}


